fixtureCharacteristic.push("ФСП05-42", [[41, 40, 36, 38, 34, 32, 30, 27], [51, 49, 44, 47, 43, 41, 39, 36], [57, 55, 48, 52, 47, 45, 44, 41], [65, 62, 54, 58, 53, 51, 49, 46], [67, 65, 56, 60, 56, 54, 52, 49], [73, 70, 62, 65, 61, 59, 58, 55], [76, 73, 64, 68, 63, 61, 60, 57], [80, 76, 66, 71, 65, 64, 62, 60], [84, 79, 68, 73, 67, 65, 64, 62], [87, 82, 69, 75, 69, 67, 67, 64]], 1, GX2442W);
