  var truncationPremisesIndex = [0.6, 0.8, 1, 1.25, 1.5, 2, 2.5, 3, 4, 5];
  
  var form=document.forms.form;          
  var premisesLength=form.elements.A;        // Длина помещения (А)
  var premisesWidth=form.elements.B;         // Ширина помещения (В)
  var premisesHeight=form.elements.h;        // Расчетная высота подвеса светильников (hр)
  var reflectionFactor=form.elements.r;      // Коэффициент отражения 
  var fixtureType=form.elements.tipeKSS;     // Тип кривой силы света (Тип КСС)
  var reservFactor=form.elements.Kz;         // Коэффициент запаса, определяется по СНиП 23-05-95 (Кз)
  var illuminationIntensity=form.elements.E; // Освещенность, определяется по МГСН 2.06-99 (Е) 
  var lightStream=form.elements.F;           // Световой поток одной лампы (Фл)
  
  premisesLength.onkeypress = pressKey;
  premisesWidth.onkeypress = pressKey;
  premisesHeight.onkeypress = pressKey;
    
  // Построение и выведение списка подходящих ламп + расчет
  function loadSubdata(obj) {
    document.getElementById('F').options.length = 0;
    var val = obj.options[obj.selectedIndex].value;
	var hel=fixtureCharacteristic[+find(fixtureCharacteristic, val)+3];
	//var opts = '';
    for (i=0; i<hel.length; i=i+2) {
	var newOpt = new Option(''+hel[i+1], hel[i]);
	    document.getElementById('F').options.add(newOpt);
    }
  }

  // Коэффициент использования светового потока
  function useFactor() {
    return fixtureCharacteristic[+find(fixtureCharacteristic, fixtureType.value)+1][+premisesIndex()][+reflectionFactor.value]/100;
  };

  // Номер элемента в последовательности
  function find(array, value) {
    if (array.indexOf) { // если метод существует
      return array.indexOf(value);
    };
    for(var i=0; i<array.length; i++) {
      if (array[i] === value) return i;
    };
    return -1;
  };

  // функция нахождения модуля числа
  function mod(chislo) {
    if (chislo>=0) {return chislo;} else {return -chislo;}
  };

  // функция нахождения отклонения двух чисел
  function deflection(chislo1, chislo2) {
    return mod(chislo1-chislo2);
  };

  // функция округления числа до ближайшего числа возрастающего массива
  function arrayTruncation(chislo, arr) {
    var okrugl = 0;
    for (var i=1; i<arr.length; i++) {
      if (deflection(chislo, arr[i])>deflection(chislo, arr[i-1])) { break; } else { okrugl=i};
    };
    return okrugl;
  };

  // Площадь помещения
  function square() {
    return premisesLength.value*premisesWidth.value;
   };

  // Индекс помещения
  function premisesIndex() {
    return arrayTruncation(square()/(premisesHeight.value*(+premisesLength.value+(+premisesWidth.value))), truncationPremisesIndex); 
  };
  
  // Расчет количества светильников  
  function calculate() {
    var fixtureQuantity=0;
    if (premisesHeight.value != 0 ) {
      var stream = (+lightStream.value)*(+fixtureCharacteristic[+find(fixtureCharacteristic, fixtureType.value)+2])
      fixtureQuantity=Math.ceil((+illuminationIntensity.value)*(+reservFactor.value)*square()/(useFactor()*stream));
    }
    form.elements.Kol.value=fixtureQuantity;
	form.elements.svet.value=stream;
  };

  // Загрузка списка светильников
  for (var j=0; j<fixtureCharacteristic.length; j=j+4) {
    var newOpt = new Option('' +fixtureCharacteristic[j], fixtureCharacteristic[j]);
    document.getElementById('tipeKSS').options.add(newOpt);
  };
  //document.getElementById('tipeKSS').innerHTML = fixturesList;
  loadSubdata(form.elements[4]);

  // Возвращает символ нажатой клавиши или null в случае специальных клавиш
  function getChar(event) {
  if (event.which == null) {
      return String.fromCharCode(event.keyCode) // IE
    } else if (event.which!=0 && event.charCode!=0  && event.which!=8 && event.which!=9 && event.which!=13) {
      return String.fromCharCode(event.which)   // остальные
    } else {
      return null; // специальная клавиша
    }
  }

  // Разрешение вводить только числа и не более одной точки точку
  function  pressKey(e) {
    var str='s'+this.value;
    e = e || event;
    var chr  = getChar(e);
    if (e.ctrlKey || e.altKey || chr == null) return; // специальная клавиша
    if ((chr<'0' || chr>'9') && (chr !='.' )) { 
      alert ('Некорректно введенный символ'); 
      return false;
    }
    if ((chr=='.') && (str.indexOf('.') !=-1 )) {
      alert ('Разделитель в числе уже присутствует'); 
      return false;
    }
  }
  document.getElementById('btn').onclick = calculate;